import React from "react";

import './apartment-box.styles.css'

const ApartmentBox = (props) => {
  return (
    <div className="apartment-box">
        <img
            src="https://static.nike.com/a/images/c_limit,w_592,f_auto/t_product_v1/4f37fca8-6bce-43e7-ad07-f57ae3c13142/air-force-1-07-mens-shoes-5QFp5Z.png"
            alt=""
        />
        <div className="top-apartment-box">
            <div className="top-left-apartment-box">
                <h1 className="apartment-name">The Colby Apartments</h1>
                <div className="apartment-description">
                    <p className="apartment-address">1515 Colby Ave, Los Angeles, CA 90025</p>
                    <p className="apartment-url">colbyapartments.com</p>
                    <p>5 Bed | 5 Bath | 500 sqft</p>
                </div>
            </div>

        </div>
        {/* <div className="experience-box-header">
            <div className="header-line-one">
                <h1 className="experience-name">{props.name}</h1>
                <h2 className="experience-location">{props.location}</h2>
            </div>
            <div className="header-line-two">
                <h2 className="experience-position">{props.position}</h2>
                <h2 className="experience-year">{props.year}</h2>
            </div>
        </div>
        <div className="experience-box-text">
            <ul className="bullet-list">
                {props.desc.map((bullet) => {
                    return (
                        <li className="bullet">{bullet}</li>
                    )
                })}
            </ul>
        </div> */}
    </div>
  );
};

export default ApartmentBox;
